import React from 'react';
import Sidebar from './Sidebar/Sidebar';
import Blogpost from './Blogpost/Blogpost';
import './style.css';

function Post() {
  return (
    <div className='Post__Section'>
      <Blogpost />
      <Sidebar />
    </div>
  );
}

export default Post;
